import React from 'react';
import TestBack from './../img/TestBack.jpg';
import './../css/Testimonials.css';
import Test1 from './../img/Test1.jpg';
import Test2 from './../img/Test2.jpg';
import Test3 from './../img/Test3.jpg';

function Testimonials() {
    return (
        <div>
            <h2>Our Happy Clients</h2>
            <div className='body'>
                <div className='img'>
                        <img src={TestBack} alt="Home_back" style={{
                                borderRadius: "10px", border: "0px",
                                borderRadius: "5px",  width: "1326px", 
                                height: "680px", backdropFilter:"blur(8px)"
                            }}/>
                </div>
                
                <div>
                    <img src={Test1}/>
                    <p>Really Great Work! Thanks a lot.</p>
                    <p>Sumit Sanyal</p>
                    <p>Project: AI Chat Bot</p>
                </div>
                <div>
                    <img src={Test2}/>
                    <p>A video testimony should be here</p>
                </div>
                <div>
                    <img src={Test3}/>
                    <p>“These guy’s did an outstanding job! The job was completed in two days & 
                        trouble shoot most of the problems with you until they find a solution! Highly recomended hiring this team. 
                        I look forward to work with them again!”</p>
                        <p>Soumik Sarkar</p>
                        <p>Project: Built a bot/Script</p>
                </div>
            </div>
            <button id='btn'>Write a Testimony</button>
        </div>
    )
}
export default Testimonials;
